angular.module("templates", []).run(["$templateCache", function($templateCache) {$templateCache.put("views/errorDialog.html","<h2>Error</h2>\n<div ng-switch=\"ngDialogData.error\">\n	<p ng-switch-when=\"not_found\">Could not find the Gist you are trying to load.</p>\n	<p ng-switch-when=\"no_files\">The loaded gist doesn\'t contain any files that could be loaded into the playground.</p>\n	<p ng-switch-when=\"limit_exceeded\">\n		You have exceeded the GitHub limit for your IP address.\n		Your limit will be reset at {{ ngDialogData.data.reset | date:\'H:mm\' }}.\n	</p>\n	<p ng-switch-when=\"generic\">An unknown error occured. Please try again later.</p>\n</div>");
$templateCache.put("views/gistLoad.html","<h2>Load from Gist</h2>\n<p>Enter the id of a GitHub Gist (the last part in its URL), that you want to load.</p>\n<p>All files in this Gist will be loaded into the playground.</p>\n<form ng-submit=\"closeThisDialog(gistId)\" class=\"gist-input\">\n	<input type=\"text\" placeholder=\"Gist Id\" ng-model=\"gistId\" class=\"gist-input__text\">\n	<button class=\"gist-input__button\"><i class=\"icon-download-cloud\"></i> Load</button>\n</form>\n");
$templateCache.put("views/gistcreated.html","<p>\nA gist has been created on GitHub from your script.\n</p>\n<a class=\"gist-link\" href=\"{{ ngDialogData.url }}\" target=\"_blank\"><i class=\"icon-github-circled\"></i> GitHub Link</a>");
$templateCache.put("views/gisterror.html","<p>An error occurred while trying to create the gist on GitHub. Please try again later.</p>");
$templateCache.put("views/info.html","<h2>About Groovy Playground</h2>\n<p>\nThis is a simple editor, where you can play around with Groovy. Just enter some Groovy\nscript in the editor and press Execute (or Control + Enter).\n</p>\n<p>\nOn the right panel you will see the output of the script and its return value. You can hover over\nthe output to highlight the lines in the editor, that generated that output. This only works as long\nas you don\'t edit the output after execution.\n</p>\n<p>\nEach time you execute your code it will be saved automatically and will be restored when you return to this page.\n</p>\n<h4>Known issues</h4>\n<ul>\n	<li><code>System.out</code> and <code>System.err</code> are not working (only <code>print/ln</code>)</li>\n	<li><code>println</code> is only working in the root of the script (and not if you use it inside a class)</li>\n</ul>\n<p>\nYou can find the list of all open issues on the\n<a href=\"https://github.com/timroes/groovyplayground\" target=\"_blank\">GitHub Page</a>.\n</p>");}]);